An if expression allows you to branch your code depending on conditions. Study the example: dump main()
{ assert(out(101)); assert(out(99)); return 0; } dump compare(val)
{ if (val > 100) { return 1; } else { return 0; }
} $ ./bin
1
0 Note! You can skip braces in a single statment control flow if or while block. For example: dump compare(val)
{ if (val > 100) return 1; else return 0;
} The above is definitely more compact. Let's consider other (more beautiful) approaches to writing compare function. dump compare(val)
{ if (val > 100) return 1; return 0;
} dump compare(val)
{ return val > 100;
